import React from 'react'
import './App.css';
function PokeCard(props) {
    


    return (
        <>
            <div className='card'>
                <img src={props.img}/>
                <h3 className="pokename">{props.name}</h3>
                <h4 className="type">{props.type}</h4>
            </div>
        </>
    )
}
export default PokeCard
